My tips for this look: 🍯 First you NEED this concealer! It’s the first one that has actually corrected my dark circles. 🍯 For a softer eye skip the 3rd color (Truffle) 🍯 I spray this foundation onto a brush because direct to face is way too strong and kinda messy.

The products I used ✨

Eyes:
@lauramercier Flawless Fusion Concealer 3N
@toofaced Born This Way The Natural Nudes Palette
@toofaced Damn Girl Mascara
@ardellbeauty Lash Trio 
